import { CREATE_NEW_USER } from "../Type";
import baseUrl from '../../Api/baseURL';
import useGetData from "../../Hooks/useGetData";
import {  } from "../../Hooks/usePostData"


// create new user 
export const createNewUser = (Data) => async (dispatch) => {

    try {
        const response = await baseUrl.usePostDataget(`/api/v1/auth/signup`, Data);
        dispatch({
            type: CREATE_NEW_USER,
            payload: response,
            loading: true
        })

    } catch (e) {
        dispatch({
            type: CREATE_NEW_USER,
            payload: e.response,
        })
    }
}
